 b = a; int& c = 42; int&& d = a; // ошибка int&& e = 42;\n} Теперь можно делать перегрузки для rvalue-ссылок: template<typename T>\nstruct vector { void push_back(T const&); void push_back(T&&);\n} В каждом месте, где делается push_back от rvalue, будет вызываться перегрузка именно для rvalue-ссылки. Важный принцип: именованные переменные они всегда lvalue, независимо от того, какой у неё тип. struct person { person(std::string&& name) { // здесь name - lvalue // this.name = name; - простое копирование this.name = std::move(name); // вызовет move-конструктор }\n} Что такое std::move? Это почти что static_cast. Её сигнатура похожа на следующее: template<typename T>\nT&& move(T& obj) { return static_cast<T&&>(obj);\n} В стандартной библиотеке у move сигнатура немного отличается. Написанная выше функция не может принимать rvalue (например, std::move(42) не скомпилируется), в стандартной библиотеке move устроен таким образом, что он работает и для rvalue тоже. Если мы хотим у конструктора, описанного выше, больше параметров, то делать перегрузки на каждую комбинацию сложно. Какое поведение конструктора мы ожидаем? Для параметров, переданных как lvalue, сделать копию, а rvalue переместить. В языке уже есть конструкция, которая делает то же самое - можно просто принять параметр по значению. struct person { person(std::string name, std::string surname) : name(std::move(name)), surname(std::move(surname)) {}\n} Так мы получим нужно поведение за исключением того, что иногда move-конструктор вызовется лишний раз (когда делаем копию и вызываем move). Обычно это оптимизируется и не влияет на производительность, но при необходимости можно сделать разные перегрузки. Не стоит использовать move там, где он не нужен : Иногда может возникать желание написать похожую конструкцию: std::string&& foo() { std::string res; res += \"abc\"; return std::move(res); } Из-за move такое, скорее всего, скомпилируется, но работать не будет, так как ссылка указывает на локальную переменную, которая уничтожится после выхода из функции. Есть правило, что если даже NRVO не сработало, то при возвращении по значению вызовется move. std::string foo() { std::string res; res += \"abc\"; return res; // вызовет move при возврате, если не сработало NRVO\n}","breadcrumbs":"Move-семантика, rvalue-ссылки » Ссылки","id":"225","title":"Ссылки"},"226":{"body":"В C++11 категории значений были расширены. Кроме lvalue и rvalue, появилось xvalue. img prvalue - то, что раньше мы называли rvalue xvalue - то, что для перегрузок rvalue, а для copy elision `glvalue`` struct mytype {};\nmytype lvalue;\nmytype& lvalue();\nmytype prvalue();\nmytype&& xvalue(); // overloading: rvalue, copy elision: lvalue\nvoid test() { mytype c = lvalue; // mytype(mytype) mytype b = prvalue(); // copy elision mytype a = xvalue(); // mytype(mytype&&)\n}\nmytype test2() { return xvalue(); } С одной стороны, xvalue возвращает rvalue, но мы не можем применить RVO. Поэтому функция xvalue для перегрузок работает как rvalue, а с точки зрения copy elision как lvalue. В C++03 время жизни объекта, который биндится к const&, продлевалось для rvalue. В C++11 xvalue ведутся себя подобно lvalue: время жизни объекта продлить нельзя, так как мы его никак не контролируем. void foo() { mytype const& a = prvalue(); // объект живёт столько, сколько эта ссылка mytype&& a = prvalue(); // аналогично продлевает время жизни mytype& a = lvalue(); // не продлевает mytype&& a = xvalue(); // не продлевает\n}","breadcrumbs":"Move-семантика, rvalue-ссылки » Value category в C++11","id":"226","title":"Value category в C++11"},"227":{"body":"","breadcrumbs":"Move-семантика, rvalue-ссылки » Запись №1","id":"227","title":"Запись №1"},"228":{"body":"","breadcrumbs":"Move-семантика, rvalue-ссылки » Запись №2","id":"228","title":"Запись №2"},"229":{"body":"В лекции часто упоминается статья \"Avoiding game crashes related to linked lists\" про то, как в Starcarft применяли интрузивные списки, и статья Intrusive linked lists in practice Так же может быть полезно смотреть на слайды к лекции .","breadcrumbs":"Интрузивные контейнеры","id":"229","title":"Интрузивные контейнеры"},"23":{"body":"Большой (до 64 бит) регистр, каждый бит - какой-то флаг. Выставляются после инструкций (CMP, арифметика и пр.) ZF - zero flag ; если рез. 0 SF - sign flag ; если рез. отрицательный CF - carry flag ; если рез. с битом переноса (для unsigned) OF - overflow flag ; если рез. переполнился (для signed) Есть команда ADC: dst = dst + src + CF Отсюда другие команды перехода : jc, jnc - jump if (not) carry flag jz, jnz - jump if (not) zero flag js, jns - jump if (not) sign flag jo, jno - jump if (not) overflow flag jb, jc - jump if carry flag ja - jump if not carry flag && not zero flag jl - OF != SF jg - OF == SF && !ZF Флаги для cmp a,b: Flags scheme Многие команды расставляют флаги, выполняя операцию: cmp - сделать вычитание, но не записывать результат test - побитовый &, но не записывает результат test ax, ax ; проверка на 0 jz L2 Пример программы с метками и прыжками: .loop: mov dx, ax add ax, bx mov bx, dx dec cx jnz loop","breadcrumbs":"Введение в ассемблер » Регистры флагов (FLAGS Registers)","id":"23","title":"Регистры флагов (FLAGS Registers)"},"230":{"body":"Задача: есть набор юнитов, нужно хранить подмножество каких-то выделенных. Наивное решение такое: struct unit { unit* prev; unit* next;\n}\nstd:unordered_set<unit*> selected; non-intrusive units Как оптимально хранить это? Одно из решений - для каждого юнита хранить selected_next и selected_prev. struct unit { unit* prev; unit* next; unit* selected_prev; unit* selected_next;\n} intrusive units Зачем это нужно? Удаление таких элементов из списка будет работать за константу без поиска, так как сам unit является узлом списка. Преимущества такой реализации: Нет аллокаций при вставке/удалении Двусвязный список использовать \"дешевле\", чем хеш-таблицу Локальность ссылок при итерации по элементам Но тратим больше памяти - храним по два указателя на каждый юнит, а не только выбранный. Всё это обобщается на другие структуры данных: двусвязные списки, деревья, хеш-таблицы со списками. Например, так можно реализовать LRU-кэш: Value f(Key key); std::unordered_map<Key, Value> cache; Хотим ограничить размер кэша. Для этого элементы провяжем двусвязным списком и будем удалять самый давний по использованию. struct node { Key key; Value value; // ordered by key node* left; node* right; node* parent; // ordered by value node* next; node* prev;\n} Тогда при обращении к элементу из кэша, он будет перекидываться в хвост, а при нехватке места, будет удалять элемент из головы списка.","breadcrumbs":"Мотивационный пример","id":"230","title":"Мотивационный пример"},"231":{"body":"","breadcrumbs":"Обобщение до контейнера","id":"231","title":"Обобщение до контейнера"},"232":{"body":"struct list_element { list_element* prev; list_element* next;\n};\nstruct unit { list_element all_units_node; // ... list_element selected_node; // ...\n}; C-style unit У такого подхода есть недостаток - перебор по контейнеру идёт по list_element и получить сам unit не так тривиально: #define container_of(ptr, type, member) \\ ((type*)((char*)(ptr) - offsetof(type, member))) По стандарту такое корректно только для C-style структур (например, без виртуальных функций). Иначе это работает, но будет ворнинг, что это нарушает стандарт.","breadcrumbs":"C-style подход","id":"232","title":"C-style подход"},"233":{"body":"Как сделать такое корректно средствами C++? Использовать базовых классы, так как каст к ним работает аналогично. struct list_element { list_element* prev; list_element* next;\n};\nstruct unit : list_element {}; Проблема возникает в том случае, если мы хотим вставить unit в несколько списков, то есть сделать ему несколько базовых классов list_element. На помощь приходят шаблоны: template <typename Tag>\nstruct list_element { list_element* prev; list_element* next;\n};\nstruct all_units_tag {};\nstruct selected_units_tag {};\nstruct unit : list_element<all_units_tag>, list_element<selected_units_tag> {}; В proposal в стандартную библиотеку использовался именно такой приём. Замечание: не обязательно типы тегов должны быть полными. Кроме того, их можно объявить прямо в объявлении unit. struct unit : list_element<struct all_units_tag>, list_element<struct selected_units_tag> {}; Реализация intrusive контейнеров есть в библиотеке Boost . Для контейнеров из буста можно задать разное поведение list_element при разрушении unit: Ничего не делать (пользователь обязан удалить юнит из списков перед тем, как удалять его) Safe hook - проверяет, что элемент удалился из всех списков Unlink hook - отвязывает элемент от всех списков, в которых он находится","breadcrumbs":"C++ подход","id":"233","title":"C++ подход"},"234":{"body":"struct person { std::string name; std::string id; std::string company_name; int min;\n} Можно хранить объекты и искать, например, по имени и по id, при помощи boost.multi_index . boost multi_index","breadcrumbs":"Полезное применение:","id":"234","title":"Полезное применение:"},"235":{"body":"Похож на shared_ptr, но счётчик ссылок хранится в самом объекте (похоже на make_shared, при использовании которого счётчик ссылок и объект создавались рядом в памяти). В отличие от shared_ptr, позволяет без динамических аллокаций реализовать разделённое владение объектом. Каждый новый инстанс intrusive_ptr увеличивает счетчик ссылок вызовом функции intrusive_ptr_add_ref, которая должна быть определена у объекта, при удалении вызывает у объекта функцию intrusive_ptr_release, которая отвечает за разрушение объекта, если счетчик ссылок стал равен нулю. В библиотеке есть вспомогательный базовый класс intrusive_ref_counter, от которого можно наследовать пользовательские типы, чтобы реализовать поддержку intrusive_ptr. Подробнее можно почитать в документации Boost","breadcrumbs":"intrusive_ptr","id":"235","title":"intrusive_ptr"},"236":{"body":"В лекции часто упоминается статья \"Avoiding game crashes related to linked lists\" про то, как в Starcarft применяли интрузивные списки, и статья Intrusive linked lists in practice Так же может быть полезно смотреть на слайды к лекции .","breadcrumbs":"Интрузивные контейнеры » Интрузивные контейнеры","id":"236","title":"Интрузивные контейнеры"},"237":{"body":"Задача: есть набор юнитов, нужно хранить подмножество каких-то выделенных. Наивное решение такое: struct unit { unit* prev; unit* next;\n}\nstd:unordered_set<unit*> selected; non-intrusive units Как оптимально хранить это? Одно из решений - для каждого юнита хранить selected_next и selected_prev. struct unit { unit* prev; unit* next; unit* selected_prev; unit* selected_next;\n} intrusive units Зачем это нужно? Удаление таких элементов из списка будет работать за константу без поиска, так как сам unit является узлом списка. Преимущества такой реализации: Нет аллокаций при вставке/удалении Двусвязный список использовать \"дешевле\", чем хеш-таблицу Локальность ссылок при итерации по элементам Но тратим больше памяти - храним по два указателя на каждый юнит, а не только выбранный. Всё это обобщается на другие структуры данных: двусвязные списки, деревья, хеш-таблицы со списками. Например, так можно реализовать LRU-кэш: Value f(Key key); std::unordered_map<Key, Value> cache; Хотим ограничить размер кэша. Для этого элементы провяжем двусвязным списком и будем удалять самый давний по использованию. struct node { Key key; Value value; // ordered by key node* left; node* right; node* parent; // ordered by value node* next; node* prev;\n} Тогда при обращении к элементу из кэша, он будет перекидываться в хвост, а при нехватке места, будет удалять элемент из головы списка.","breadcrumbs":"Интрузивные контейнеры » Мотивационный пример","id":"237","title":"Мотивационный пример"},"238":{"body":"","breadcrumbs":"Интрузивные контейнеры » Обобщение до контейнера","id":"238","title":"Обобщение до контейнера"},"239":{"body":"struct list_element { list_element* prev; list_element* next;\n};\nstruct unit { list_element all_units_node; // ... list_element selected_node; // ...\n}; C-style unit У такого подхода есть недостаток - перебор по контейнеру идёт по list_element и получить сам unit не так тривиально: #define container_of(ptr, type, member) \\ ((type*)((char*)(ptr) - offsetof(type, member))) По стандарту такое корректно только для C-style структур (например, без виртуальных функций). Иначе это работает, но будет ворнинг, что это нарушает стандарт.","breadcrumbs":"Интрузивные контейнеры » C-style подход","id":"239","title":"C-style подход"},"24":{"body":"Заходим в функции и выходим из них в порядке стека. Есть специальный регистр SP, который указывает на вершину стека. Стек - от старших адресов к младшим. push src ; SP -= 2, так как 2 байта. mem[SP] = src pop src ; tmp = mem[SP], SP += 2, dst = tmp Команды работы со стеком. Стек позволяет сохранять старые значения, которые необходимо вернуть: call\tlabel ; вызов ф-иии ret ; выход из ф-ии ; по своей сути эти строки равносильны: push next_instr jmp label ... pop tmp ; return к следующей инструкции jmp tmp","breadcrumbs":"Введение в ассемблер » Вызов функций и выход из них","id":"24","title":"Вызов функций и выход из них"},"240":{"body":"Как сделать такое корректно средствами C++? Использовать базовых классы, так как каст к ним работает аналогично. struct list_element { list_element* prev; list_element* next;\n};\nstruct unit : list_element {}; Проблема возникает в том случае, если мы хотим вставить unit в несколько списков, то есть сделать ему несколько базовых классов list_element. На помощь приходят шаблоны: template <typename Tag>\nstruct list_element { list_element* prev; list_element* next;\n};\nstruct all_units_tag {};\nstruct selected_units_tag {};\nstruct unit : list_element<all_units_tag>, list_element<selected_units_tag> {}; В proposal в стандартную библиотеку использовался именно такой приём. Замечание: не обязательно типы тегов должны быть полными. Кроме того, их можно объявить прямо в объявлении unit. struct unit : list_element<struct all_units_tag>, list_element<struct selected_units_tag> {}; Реализация intrusive контейнеров есть в библиотеке Boost . Для контейнеров из буста можно задать разное поведение list_element при разрушении unit: Ничего не делать (пользователь обязан удалить юнит из списков перед тем, как удалять его) Safe hook - проверяет, что элемент удалился из всех списков Unlink hook - отвязывает элемент от всех списков, в которых он находится","breadcrumbs":"Интрузивные контейнеры » C++ подход","id":"240","title":"C++ подход"},"241":{"body":"struct person { std::string name; std::string id; std::string company_name; int min;\n} Можно хранить объекты и искать, например, по имени и по id, при помощи boost.multi_index . boost multi_index","breadcrumbs":"Интрузивные контейнеры » Полезное применение:","id":"241","title":"Полезное применение:"},"242":{"body":"Похож на shared_ptr, но счётчик ссылок хранится в самом объекте (похоже на make_shared, при использовании которого счётчик ссылок и объект создавались рядом в памяти). В отличие от shared_ptr, позволяет без динамических аллокаций реализовать разделённое владение объектом. Каждый новый инстанс intrusive_ptr увеличивает счетчик ссылок вызовом функции intrusive_ptr_add_ref, которая должна быть определена у объекта, при удалении вызывает у объекта функцию intrusive_ptr_release, которая отвечает за разрушение объекта, если счетчик ссылок стал равен нулю. В библиотеке есть вспомогательный базовый класс intrusive_ref_counter, от которого можно наследовать пользовательские типы, чтобы реализовать поддержку intrusive_ptr. Подробнее можно почитать в документации Boost","breadcrumbs":"Интрузивные контейнеры » intrusive_ptr","id":"242","title":"intrusive_ptr"},"243":{"body":"","breadcrumbs":"Интрузивные контейнеры » Запись №1","id":"243","title":"Запись №1"},"244":{"body":"","breadcrumbs":"Интрузивные контейнеры » Разбор практики по intrusive_list","id":"244","title":"Разбор практики по intrusive_list"},"245":{"body":"","breadcrumbs":"Интрузивные контейнеры » Код intrusive_list","id":"245","title":"Код intrusive_list"},"246":{"body":"","breadcrumbs":"Smart pointers: unique_ptr, shared_ptr, weak_ptr","id":"246","title":"Smart pointers: unique_ptr, shared_ptr, weak_ptr"},"247":{"body":"","breadcrumbs":"Smart pointers: unique_ptr, shared_ptr, weak_ptr » Smart pointers: unique_ptr, shared_ptr, weak_ptr","id":"247","title":"Smart pointers: unique_ptr, shared_ptr, weak_ptr"},"248":{"body":"","breadcrumbs":"Smart pointers: unique_ptr, shared_ptr, weak_ptr » Запись №1","id":"248","title":"Запись №1"},"249":{"body":"","breadcrumbs":"Smart pointers: unique_ptr, shared_ptr, weak_ptr » Запись №2","id":"249","title":"Запись №2"},"25":{"body":"ABI - application binary interface. Программе нужно вызывать какие-то функции операционной системы. ABI - набор соглашений для доступа приложений к операционной системе, там прописано всё про функции и прочее, в том числе размеры типов данных.","breadcrumbs":"Введение в ассемблер » ABI","id":"25","title":"ABI"},"250":{"body":"Когда мы говорили про shared_ptr, у нас была функция make_shared, которая принимала какие-то аргументы и передавала их в конструктор. Посмотрим на возможные реализацию такой функции (для упрощения на примере одного параметра): template<typename T>\nvoid g1(T a){ f(a);\n}\ntemplate<typename T>\nvoid g2(T const& a){ f(a);\n}\ntemplate<typename T>\nvoid g3(T& a){ f(a);\n} Все 3 случая не подходят: Принимать по значению неприятно, если объект дорого копировать Принимать по const& не получится, если на самом деле функция f принимает ссылку Принимать по & нельзя, так как она не биндится к rvalue Можно было бы сделать перегрузку с & и const&, но тогда нужно 2^n перегрузок для n параметров, что не очень удобно. Perfect forwarding - принять аргументы и передать их куда-то с теми свойствами, с которыми они пришли (rvalue/lvalue, cv). В C++11 есть специальный механизм для решения этой проблемы. Чтобы понять, как оно работает, нужно познакомиться с правилами вывода ссылок в C++11.","breadcrumbs":"Perfect forwarding","id":"250","title":"Perfect forwarding"},"251":{"body":"В C++ нельзя сделать ссылку на ссылку, поэтому ссылки схлопываются (коллапсятся): typedef int& mytype1;\ntypedef mytype1& mytype2;\nstatic_assert(std::is_same_v<mytype2, mytype1>); // true template <typename T>\nvoid foo(T&); int main() { foo<int&>(); // void foo(int&)\n} Это было в языке всегда с момента появления ссылок. Когда появились rvalue ссылки, правила схлопывания ссылок доопределили: & & -> &\n& && -> &\n&& & -> &\n&& && -> &&","breadcrumbs":"Reference collapsing rule","id":"251","title":"Reference collapsing rule"},"252":{"body":"Чтобы сделать perfect forwarding, нужно как-то запомнить, передавалось в шаблон rvalue или lvalue. В C++11 правила вывода шаблонных параметров были определены специальным образом, который позволяет сохранить эту информацию: template <typename T>\nvoid g(T&& a) { f(a);\n} int main { g(42); // rvalue: T -> int, void g(int&&) int a; g(a); // lvalue: T -> int&, void g(int&)\n} Такие ссылки (шаблонный параметр + rvalue-ссылка) называются универсальными .","breadcrumbs":"Universal reference","id":"252","title":"Universal reference"},"253":{"body":"Как передавать параметр дальше? Внутри тела функции параметр это именованная переменная, поэтому она lvalue (ситуация очень похожа на то, как вводили std::move). Для этого передачи параметра так, как он пришёл, существует std::forward. Можно сделать так: template <typename T>\nvoid g(T&& a) { f(static_cast<T&&>(a));\n} int main { g(42); // rvalue: T -> int, void g(int&&), f(static_cast<int&&>(a)) int a; g(a); // lvalue: T -> int&, void g(int&), f(static_cst<int&>(a))\n} Библиотечная функция написана примерно так: template<typename T>\nT&& forward(T& obj) { return static_cast<T&&>(obj);\n} template <typename T>\nvoid g(T&& a) { f(forward<T>(a));\n} Такой forward может быть не очень хорошим по нескольким причинам: Если забыть написать тип явно в вызове, то он будет выводится и выведется не так, как нам надо. Это фиксится следующим образом: template <typename T>\nstruct type_identity { typedef T type;\n}; template <typename T>\nT&& forward(typename type_identity<T>::type& obj) { return static_cast<T&&>(obj);\n} В STL вместо type_identity используется remove_reference. Так же есть перегрузка для rvalue (T&&), которая применяется, например, для форварда значения, возвращаемого функцией.","breadcrumbs":"std::forward","id":"253","title":"std::forward"},"254":{"body":"Осталось понять, как делать функцию, принимающую произвольное число шаблонных параметров. Для этого в C++ сделали специальный синтаксис: template <typename... T>\nvoid g(T&& ...args) { f(std::forward<T>(args)...);\n} Можно думать, что ... пишутся там, где обычно аргументы перечисляются через запятую.","breadcrumbs":"Variadic template","id":"254","title":"Variadic template"},"255":{"body":"Когда мы говорили про shared_ptr, у нас была функция make_shared, которая принимала какие-то аргументы и передавала их в конструктор. Посмотрим на возможные реализацию такой функции (для упрощения на примере одного параметра): template<typename T>\nvoid g1(T a){ f(a);\n}\ntemplate<typename T>\nvoid g2(T const& a){ f(a);\n}\ntemplate<typename T>\nvoid g3(T& a){ f(a);\n} Все 3 случая не подходят: Принимать по значению неприятно, если объект дорого копировать Принимать по const& не получится, если на самом деле функция f принимает ссылку Принимать по & нельзя, так как она не биндится к rvalue Можно было бы сделать перегрузку с & и const&, но тогда нужно 2^n перегрузок для n параметров, что не очень удобно. Perfect forwarding - принять аргументы и передать их куда-то с теми свойствами, с которыми они пришли (rvalue/lvalue, cv). В C++11 есть специальный механизм для решения этой проблемы. Чтобы понять, как оно работает, нужно познакомиться с правилами вывода ссылок в C++11.","breadcrumbs":"Perfect forwarding, variadic templates » Perfect forwarding","id":"255","title":"Perfect forwarding"},"256":{"body":"В C++ нельзя сделать ссылку на ссылку, поэтому ссылки схлопываются (коллапсятся): typedef int& mytype1;\ntypedef mytype1& mytype2;\nstatic_assert(std::is_same_v<mytype2, mytype1>); // true template <typename T>\nvoid foo(T&); int main() { foo<int&>(); // void foo(int&)\n} Это было в языке всегда с момента появления ссылок. Когда появились rvalue ссылки, правила схлопывания ссылок доопределили: & & -> &\n& && -> &\n&& & -> &\n&& && -> &&","breadcrumbs":"Perfect forwarding, variadic templates » Reference collapsing rule","id":"256","title":"Reference collapsing rule"},"257":{"body":"Чтобы сделать perfect forwarding, нужно как-то запомнить, передавалось в шаблон rvalue или lvalue. В C++11 правила вывода шаблонных параметров были определены специальным образом, который позволяет сохранить эту информацию: template <typename T>\nvoid g(T&& a) { f(a);\n} int main { g(42); // rvalue: T -> int, void g(int&&) int a; g(a); // lvalue: T -> int&, void g(int&)\n} Такие ссылки (шаблонный параметр + rvalue-ссылка) называются универсальными .","breadcrumbs":"Perfect forwarding, variadic templates » Universal reference","id":"257","title":"Universal reference"},"258":{"body":"Как передавать параметр дальше? Внутри тела функции параметр это именованная переменная, поэтому она lvalue (ситуация очень похожа на то, как вводили std::move). Для этого передачи параметра так, как он пришёл, существует std::forward. Можно сделать так: template <typename T>\nvoid g(T&& a) { f(static_cast<T&&>(a));\n} int main { g(42); // rvalue: T -> int, void g(int&&), f(static_cast<int&&>(a)) int a; g(a); // lvalue: T -> int&, void g(int&), f(static_cst<int&>(a))\n} Библиотечная функция написана примерно так: template<typename T>\nT&& forward(T& obj) { return static_cast<T&&>(obj);\n} template <typename T>\nvoid g(T&& a) { f(forward<T>(a));\n} Такой forward может быть не очень хорошим по нескольким причинам: Если забыть написать тип явно в вызове, то он будет выводится и выведется не так, как нам надо. Это фиксится следующим образом: template <typename T>\nstruct type_identity { typedef T type;\n}; template <typename T>\nT&& forward(typename type_identity<T>::type& obj) { return static_cast<T&&>(obj);\n} В STL вместо type_identity используется remove_reference. Так же есть перегрузка для rvalue (T&&), которая применяется, например, для форварда значения, возвращаемого функцией.","breadcrumbs":"Perfect forwarding, variadic templates » std::forward","id":"258","title":"std::forward"},"259":{"body":"Осталось понять, как делать функцию, принимающую произвольное число шаблонных параметров. Для этого в C++ сделали специальный синтаксис: template <typename... T>\nvoid g(T&& ...args) { f(std::forward<T>(args)...);\n} Можно думать, что ... пишутся там, где обычно аргументы перечисляются через запятую.","breadcrumbs":"Perfect forwarding, variadic templates » Variadic template","id":"259","title":"Variadic template"},"26":{"body":"void f(char const*); void g()\n{ char arr[113]; f(arr);\n} Компилируется в: g(): sub rsp, 136 mov rdi, rsp call f(char const*) add rsp, 136 ret К локальным переменным обращаемся через rsp, лежат на стеке. Размер стека - переменная на уровне операционной системы (вроде). Обратим внимание на то, что если изменить размер массива на 112 , то этот код скомпилируется в: g(): sub rsp, 120 mov rdi, rsp call f(char const*) add rsp, 120 ret Почему 136 изменилось на 120? Этот эффект называется выравниванием (alignment). В качестве основной единицы работы с памятью используется машинное слово , размер которого обычно составляет несколько байт. Так называемый \"unaligned access\" сложен в реализации на аппаратном уровне, поэтому обращения по произвольному адресу либо не поддерживаются (и вызывают исключение процессора), либо поддерживаются, но работают медленно. Обычно компилятор выравнивает данные по границам машинных слов, в нашем случае 8 + 16 * k.","breadcrumbs":"Введение в ассемблер » Выделение памяти:","id":"26","title":"Выделение памяти:"},"260":{"body":"","breadcrumbs":"Perfect forwarding, variadic templates » Запись №1","id":"260","title":"Запись №1"},"261":{"body":"","breadcrumbs":"Perfect forwarding, variadic templates » Запись №2","id":"261","title":"Запись №2"},"262":{"body":"","breadcrumbs":"CONTRIBUTING","id":"262","title":"CONTRIBUTING"},"27":{"body":"","breadcrumbs":"ОС, процессор и память","id":"27","title":"ОС, процессор и память"},"28":{"body":"Почему программа с вечным циклом не повесит нам весь компьютер, даже если у нас всего одно ядро? Как ОС работает с устройствами? Всё это завязано на перерываниях. Что происходит при прерывании: Значения регистров текущего процесса дампаются в оперативную память Подгружаются значения регистров другого процесса и исполнение передаётся ему Такая схема называется вытесняющей многозадачностью . Способы прерывания на устройства: Polling - процессор сам опрашивает устройства, когда считает нужным. Interrupt (прерывание) - устройство само говорит об изменении, процессор вызывает обработчик прерываний. Local timer interrupt - прерывания по таймеру, своё у каждого ядра ЦП. ОС заводит таймер, таймер срабатывает, провоцирует прерывание и ОС получает управление в обработчике прерываний. На самом деле, всё сложнее, потому что постоянно работающие таймеры это неэкономно, поэтому он, например, отключается, если на ядре ничего не исполняется. Rescheduling interrupts - прерывания, используещиеся для перепланировки (миграции) процесса на другое ядро в целях распределения нагрузки. Реализованы с помощью IPI .","breadcrumbs":"Прерывания","id":"28","title":"Прерывания"},"29":{"body":"ОС реализует следующие принципы: hardware abstraction - мышка может быть подключена по-разному подключенной, но программе всё равно isolation process - программа не может повлиять на другие программы (записать в их память) Это достигается следующим образом: Физическая память - реальный модуль памяти (как на ЭВМ) Виртуальная память - пространство памяти процессов, \"то, что видит программа\". Обращение по адресу памяти в программе - обращение по адресу в виртуальной памяти. Процесс преобразования из виртуальной в физическую называется трансляцией адресов и реализуется в специальном блоке процессора MMU дальше везде рассматривается 32-битная система","breadcrumbs":"Про память","id":"29","title":"Про память"},"3":{"body":"Команды для хранения в памяти кодируются: 89 C2 mov edx, eax\t; EDX = EAX\nB8 05 00 00 00 mov eax, 5 ; EAX = 5 mov может копировать содержимое памяти по адресу: mov ax, [10]\t; Переместить в регистр из памяти по адресу 10 mov ax, [bx]\t; Переместить в регистр из памяти по адресу в BX mov [bx], ax\t; Переместить в память по адресу BX содержимое AX mov [bx], [ax]\t; WRONG! из памяти в память нельзя. Оно даже не скомпилируется Забавный факт: [ax] невалидный адрес, больше можно почитать здесь Команда mov ax,[bx] читает из ячейки с адресом BX и BX + 1: AX = mem[BX + 1] * 256 + mem[BX]","breadcrumbs":"Команда mov","id":"3","title":"Команда mov"},"30":{"body":"Способ организации виртуальной памяти, при котором виртуальные адреса отображаются на физические постранично (обычно 1 страница = 4 КB). Память процесса может лежать в физической памяти в любом порядке: Memory Disorder Адресация реализуется через PageTables . Вместо массива на много элементов храним массив ( каталог страниц ) размера 1024 из указателей на массивы размерами по 1024 ( таблицы страниц ). Почему это удобнее? Некоторые таблицы можно не хранить, если нужно выделить не все. Это выглядит как-то так: Page Table Page Table Для ускорения трансляции применяется специальный кеш TLB (Translation lookaside buffer). Подробнее можно прочитать тут: https://wiki.osdev.org/Paging","breadcrumbs":"Страничная адресация","id":"30","title":"Страничная адресация"},"31":{"body":"Пример адреса: Virtual adress - 0x123456789A Младшие 12 бит виртуального адреса: смещение внутри страницы. Следующие 10 бит - индекс в таблице страниц, старшие 10 бит - индекс в каталоге страниц. typedef uint32_t page_table_element;\ntypedef uint32_t virtual_address;\nstruct page_directory\n{ uint32_t translate(virtual_address); private: page_table_element data[1024];\n}; Альтернативы: Хеш-таблица : плохо взаимодействует с кэшем. Использовалась в PowerPC Это всё было про 32-битную архитектуру . На 64-битной числа так красиво не сходятся. Используют следующее: добавляется ещё один уровень (можно и не один, на самом деле), массивы делают по 512. Пример: процессор может транслировать только 48 бит (соответствует размеру дерева из уровней). Физической памяти - 39 бит. Почему? \"Сколько пинов у процессора есть, чтобы обращаться к памяти, столько и бит\". Остальные биты в 64-битном адресе заполнены одинаковыми значениями и мы их не используем. В регистре CR3 хранится указатель на каталог страниц для процесса.","breadcrumbs":"Механизм адресации на уровне процессора:","id":"31","title":"Механизм адресации на уровне процессора:"},"32":{"body":"syscall - интерфейс взаимодействия процесса программы с ядром ОС. Например, это чтение/запись в файла/терминала, завершение программы с кодом ошибки и т.д. rip - регистр, в котором хранится адрес исполняемой инструкции в памяти main: mov rdx, 42 push 43 push 44 call bar\nbar: sub rsp, 40 ; add rsp,40 ret Как понять, кто вызывал функцию? (WIP) Stack frame (кадр стека) - условная часть стека, принадлежащая вызванной функции. Содержит стековые переменные, адрес возврата и, опционально, описанный далее frame pointer Компилятор умеет внедрять в файл специальную отладочную информацию: бесплатно по производительности, но занимает место в памяти. Альтернатива: в скомпилированном коде при вызове функции обновляется stack frame pointer (указатель на кадр стека), таким образом кадры образуют односвязный список, а стек можно \"раскрутить\" (unwind). Плюсы: без лишних телодвижений программа может узнать свой стек вызовов без отладчика. Минусы: при обильном вызове функций теряем в производительности. rbp - регистр, который используется для указания на предыдущий кадр стека. На https://godbolt.org можно посмотреть, что следующий код: int foo(char const*); int bar()\n{ char arr[40]; return foo(arr) + 1;\n} с флагами -O2 -fno-omit-frame-pointer компилируется во что-то такое: bar: push rbp mov rbp, rsp sub rbp, 40 ; mov rsp, rbp pop rbp ret","breadcrumbs":"Про системные вызовы, стек вызовов и frame pointer","id":"32","title":"Про системные вызовы, стек вызовов и frame pointer"},"33":{"body":"","breadcrumbs":"Прерывания, страничная адресация и т.д. » ОС, процессор и память","id":"33","title":"ОС, процессор и память"},"34":{"body":"Почему программа с вечным циклом не повесит нам весь компьютер, даже если у нас всего одно ядро? Как ОС работает с устройствами? Всё это завязано на перерываниях. Что происходит при прерывании: Значения регистров текущего процесса дампаются в оперативную память Подгружаются значения регистров другого процесса и исполнение передаётся ему Такая схема называется вытесняющей многозадачностью . Способы прерывания на устройства: Polling - процессор сам опрашивает устройства, когда считает нужным. Interrupt (прерывание) - устройство само говорит об изменении, процессор вызывает обработчик прерываний. Local timer interrupt - прерывания по таймеру, своё у каждого ядра ЦП. ОС заводит таймер, таймер срабатывает, провоцирует прерывание и ОС получает управление в обработчике прерываний. На самом деле, всё сложнее, потому что постоянно работающие таймеры это неэкономно, поэтому он, например, отключается, если на ядре ничего не исполняется. Rescheduling interrupts - прерывания, используещиеся для перепланировки (миграции) процесса на другое ядро в целях распределения нагрузки. Реализованы с помощью IPI .","breadcrumbs":"Прерывания, страничная адресация и т.д. » Прерывания","id":"34","title":"Прерывания"},"35":{"body":"ОС реализует следующие принципы: hardware abstraction - мышка может быть подключена по-разному подключенной, но программе всё равно isolation process - программа не может повлиять на другие программы (записать в их память) Это достигается следующим образом: Физическая память - реальный модуль памяти (как на ЭВМ) Виртуальная память - пространство памяти процессов, \"то, что видит программа\". Обращение по адресу памяти в программе - обращение по адресу в виртуальной памяти. Процесс преобразования из виртуальной в физическую называется трансляцией адресов и реализуется в специальном блоке процессора MMU дальше везде рассматривается 32-битная система","breadcrumbs":"Прерывания, страничная адресация и т.д. » Про память","id":"35","title":"Про память"},"36":{"body":"Способ организации виртуальной памяти, при котором виртуальные адреса отображаются на физические постранично (обычно 1 страница = 4 КB). Память процесса может лежать в физической памяти в любом порядке: Memory Disorder Адресация реализуется через PageTables . Вместо массива на много элементов храним массив ( каталог страниц ) размера 1024 из указателей на массивы размерами по 1024 ( таблицы страниц ). Почему это удобнее? Некоторые таблицы можно не хранить, если нужно выделить не все. Это выглядит как-то так: Page Table Page Table Для ускорения трансляции применяется специальный кеш TLB (Translation lookaside buffer). Подробнее можно прочитать тут: https://wiki.osdev.org/Paging","breadcrumbs":"Прерывания, страничная адресация и т.д. » Страничная адресация","id":"36","title":"Страничная адресация"},"37":{"body":"Пример адреса: Virtual adress - 0x123456789A Младшие 12 бит виртуального адреса: смещение внутри страницы. Следующие 10 бит - индекс в таблице страниц, старшие 10 бит - индекс в каталоге страниц. typedef uint32_t page_table_element;\ntypedef uint32_t virtual_address;\nstruct page_directory\n{ uint32_t translate(virtual_address); private: page_table_element data[1024];\n}; Альтернативы: Хеш-таблица : плохо взаимодействует с кэшем. Использовалась в PowerPC Это всё было про 32-битную архитектуру . На 64-битной числа так красиво не сходятся. Используют следующее: добавляется ещё один уровень (можно и не один, на самом деле), массивы делают по 512. Пример: процессор может транслировать только 48 бит (соответствует размеру дерева из уровней). Физической памяти - 39 бит. Почему? \"Сколько пинов у процессора есть, чтобы обращаться к памяти, столько и бит\". Остальные биты в 64-битном адресе заполнены одинаковыми значениями и мы их не используем. В регистре CR3 хранится указатель на каталог страниц для процесса.","breadcrumbs":"Прерывания, страничная адресация и т.д. » Механизм адресации на уровне процессора:","id":"37","title":"Механизм адресации на уровне процессора:"},"38":{"body":"syscall - интерфейс взаимодействия процесса программы с ядром ОС. Например, это чтение/запись в файла/терминала, завершение программы с кодом ошибки и т.д. rip - регистр, в котором хранится адрес исполняемой инструкции в памяти main: mov rdx, 42 push 43 push 44 call bar\nbar: sub rsp, 40 ; add rsp,40 ret Как понять, кто вызывал функцию? (WIP) Stack frame (кадр стека) - условная часть стека, принадлежащая вызванной функции. Содержит стековые переменные, адрес возврата и, опционально, описанный далее frame pointer Компилятор умеет внедрять в файл специальную отладочную информацию: бесплатно по производительности, но занимает место в памяти. Альтернатива: в скомпилированном коде при вызове функции обновляется stack frame pointer (указатель на кадр стека), таким образом кадры образуют односвязный список, а стек можно \"раскрутить\" (unwind). Плюсы: без лишних телодвижений программа может узнать свой стек вызовов без отладчика. Минусы: при обильном вызове функций теряем в производительности. rbp - регистр, который используется для указания на предыдущий кадр стека. На https://godbolt.org можно посмотреть, что следующий код: int foo(char const*); int bar()\n{ char arr[40]; return foo(arr) + 1;\n} с флагами -O2 -fno-omit-frame-pointer компилируется во что-то такое: bar: push rbp mov rbp, rsp sub rbp, 40 ; mov rsp, rbp pop rbp ret","breadcrumbs":"Прерывания, страничная адресация и т.д. » Про системные вызовы, стек вызовов и frame pointer","id":"38","title":"Про системные вызовы, стек вызовов и frame pointer"},"39":{"body":"","breadcrumbs":"Прерывания, страничная адресация и т.д. » Запись №1","id":"39","title":"Запись №1"},"4":{"body":"cmd dst, src add ax, cx ; AX = AX + CX sub ax, cx ; AX = AX - CX, аналогично AND, OR, XOR inc ax ; AX += 1 inc BYTE [bx]\t; INC одного байта inc WORD [bx]\t; INC числа из двух байт (дальше DWORD и т.д.) dec ax ; AX -= 1 neg ax ; AX = -AX not ax ; AX = ~AX(побитово) mul src ; unsigned, в пару DX:AX = src*AX, DX - старшая часть, AX - младшая imul src ; signed div src ; unsigned, AX = DX:AX / src, DX = DX:AX % src idiv src ; signed Перед делением 16-битного зануляем регистр DX: xor dx, dx ; не \"mov dx,0\", так как кодируется короче div bx cwd ; сохраняет знак: берёт старший бит из AX, заполняет им DX idiv bx При этом в команде DIV если частное не помещается в AX, то это такая же ошибка, как деление на 0","breadcrumbs":"Команды арифметики","id":"4","title":"Команды арифметики"},"40":{"body":"","breadcrumbs":"Прерывания, страничная адресация и т.д. » Запись №2","id":"40","title":"Запись №2"},"41":{"body":"Optimize for data first, then code. Memory access is probably going to be your biggest bottleneck Одинаково ли по времени будет работать следующий код? for i = 0..n: for i=0..n: for j=0..n: for j=0..n: a[i][j] = 0 a[j][i] = 0 У этих двух кодов большая разница из-за процессорного кэша. Первый цикл обращается к памяти последовательно, а второй \"скачет\" по ней. Поэтому обращения к памяти первого цикла попадают в кэш, а второго - нет. С ростом N видна разница между уровнями кэша на графике времени обработки одного элемента: Cache Hit Graph Небольшие пики - скачки из-за попадания в один бакет (заметно на степенях двойки), сильное изменение времени работы происходит, когда данные перестают попадать в кэш какого-то уровня. Кэш реализован через хэш-таблицы (дискретного размера), где ключ - адрес в памяти. Линии кэша примерно по 64 байта разделенные на группы (buckets), размеры которых называются ассоциативностью кэша. Подробнее про кэш можно прочитать в конспектах по ЭВМ Prefetching - если много кэш-промахов, запрашиваем заранее подгрузить в кэш. Это работает на уровне кэш-подсистемы процессора, а не компилятора/ОС. Пример : хранение хэш-таблицы с открытой адресацией. Два варианта: Hash-Table Если ожидаются частые попадания, то хранить полезнее данные рядом с ключом. Если ожидаются редкие попадания, то лучше хранить ключи и данные отдельно.","breadcrumbs":"Кэш-память","id":"41","title":"Кэш-память"},"42":{"body":"Зачем нужен? Это кэш для ускорения трансляции виртуального адреса в физический. Так же, как и обычный, может быть нескольких уровней.","breadcrumbs":"TLB - translation lookaside buffer","id":"42","title":"TLB - translation lookaside buffer"},"43":{"body":"Идея : отображать страницу памяти в лежащую подряд физическую память. Тогда проще обходить каталог страниц. Например, если программе нужно прочитать 1 Мбайт непрерывных данных, которых нет в TLB кэше, то нужно сделать обращение к 256 страницам. Но использовать тяжело, так как с ними тяжело делать swap (подкачка страниц). Например, в Windows требуются специальные права, чтобы выделять не-swappable память. Swap - хотим выделить памяти больше, чем у нас есть физической (оперативной). Особенно было актуально раньше, когда оперативной памяти было мало. Некоторые страницы из оперативной памяти записывались на диск и помечались недоступными, но при необходимости можно было вытеснить другую страницу и выгрузить нужную с диска.","breadcrumbs":"Huge Pages","id":"43","title":"Huge Pages"},"44":{"body":"Ну тут опять всё как было на ЭВМ . Разбили выполнение команды на несколько стадий, теперь можем повысить частоту, так как каждая стадия стала проще. Выигрыш в том, что можем давать новые данные на каждом такте. Спекулятивное исполнение : условные переходы дорогие, поэтому мы предсказываем переход, выполняем, а если не угадали, то откатываемя. В общем, ничего нового. Также это называется branch prediction . Можем как выиграть, так и проиграть от этого. Например, в некоторых программах на отсортированном массиве предсказание может улучшить время работы в несколько раз. Полезно писать программу так, чтобы уровень зависимостей команд был как можно меньше (это может также пытаться делать компилятор). Например: int f(int a, int b, int c, int d)\n{ return a * b * c * d;\n} может скомпилиться в следующий код, чтоб уменьшить количество зависимых умножений: (a* b) * (c * d) imul edi, esi imul edx, ecx imul edx, edi mov eax, edx ret Похожее происходит с циклами. Посмотрим на алгоритм Хаффмана: void count_huffman_weights(char const* src, size_t size)\n{ uint32_t count[256] = {0}; for (size_t i = 0; i != size; ++i) ++count[src[i]];\n} может быть разбит компилятором на параллельные исполнения. Так будут выглядеть зависимости: Dependencies Но у нас возникают проблемы из-за того, что мы пишем в одни переменные. Как пофиксить? Можем сделать 8 разных массивов-счетчиков. Такая реализация используется в библиотеке Zstandart void count_huffman_weights_improved(char const* src, size_t size)\n{ uint32_t count[8][256] = {}; size = size / 8 * 8; for (size_t i = 0; i < size;) { ++count[0][src[i++]]; ++count[1][src[i++]]; ++count[2][src[i++]]; ++count[3][src[i++]]; ++count[4][src[i++]]; ++count[5][src[i++]]; ++count[6][src[i++]]; ++count[7][src[i++]]; }\n} ​\tПолезные книжки по теме: J. Shen, M. Lipasti — Modern Processor Design: Fundamentals of Superscalar Processors J. Hennessy, D. Patterson — Computer Architecture: A Quantitative Approach","breadcrumbs":"Конвейер (Pipelining)","id":"44","title":"Конвейер (Pipelining)"},"45":{"body":"Optimize for data first, then code. Memory access is probably going to be your biggest bottleneck Одинаково ли по времени будет работать следующий код? for i = 0..n: for i=0..n: for j=0..n: for j=0..n: a[i][j] = 0 a[j][i] = 0 У этих двух кодов большая разница из-за процессорного кэша. Первый цикл обращается к памяти последовательно, а второй \"скачет\" по ней. Поэтому обращения к памяти первого цикла попадают в кэш, а второго - нет. С ростом N видна разница между уровнями кэша на графике времени обработки одного элемента: Cache Hit Graph Небольшие пики - скачки из-за попадания в один бакет (заметно на степенях двойки), сильное изменение времени работы происходит, когда данные перестают попадать в кэш какого-то уровня. Кэш реализован через хэш-таблицы (дискретного размера), где ключ - адрес в памяти. Линии кэша примерно по 64 байта разделенные на группы (buckets), размеры которых называются ассоциативностью кэша. Подробнее про кэш можно прочитать в конспектах по ЭВМ Prefetching - если много кэш-промахов, запрашиваем заранее подгрузить в кэш. Это работает на уровне кэш-подсистемы процессора, а не компилятора/ОС. Пример : хранение хэш-таблицы с открытой адресацией. Два варианта: Hash-Table Если ожидаются частые попадания, то хранить полезнее данные рядом с ключом. Если ожидаются редкие попадания, то лучше хранить ключи и данные отдельно.","breadcrumbs":"Кэши, конвейер » Кэш-память","id":"45","title":"Кэш-память"},"46":{"body":"Зачем нужен? Это кэш для ускорения трансляции виртуального адреса в физический. Так же, как и обычный, может быть нескольких уровней.","breadcrumbs":"Кэши, конвейер » TLB - translation lookaside buffer","id":"46","title":"TLB - translation lookaside buffer"},"47":{"body":"Идея : отображать страницу памяти в лежащую подряд физическую память. Тогда проще обходить каталог страниц. Например, если программе нужно прочитать 1 Мбайт непрерывных данных, которых нет в TLB кэше, то нужно сделать обращение к 256 страницам. Но использовать тяжело, так как с ними тяжело делать swap (подкачка страниц). Например, в Windows требуются специальные права, чтобы выделять не-swappable память. Swap - хотим выделить памяти больше, чем у нас есть физической (оперативной). Особенно было актуально раньше, когда оперативной памяти было мало. Некоторые страницы из оперативной памяти записы